create table vehiculo (
	modelo VARCHAR(50),
	ano VARCHAR(50),
	marca VARCHAR(50),
	refraccion VARCHAR(50),
	no_cilindros INT,
	no_puertas DECIMAL(10,2),
	primary key (modelo,ano)
);

create table dadoDeBaja (
	idVehiculoBaja VARCHAR(50),
	modelo VARCHAR(6),
	ano VARCHAR(6),
	motivo VARCHAR(50),
	fecha_final DATE,
	primary key (idVehiculoBaja)
);


create table enOperacion (
	idVehiculoOperacion VARCHAR(50),
	modelo VARCHAR(6),
	ano VARCHAR(6),
	primary key (idVehiculoOperacion)
);

--1
SELECT idMiembro, idVehiculo, no_asociacion, nombre
	fecha_I, domicilio, fotografia, email, no_celular,
	esDueo, esChofer
FROM miembroAsociacion, enOperacion
WHERE miembroAsociacion.idVehiculo = enOperacion.idVehiculoOperacion;

--2
SELECT*
FROM vehiculo
WHERE no_puertas > 2 AND LOWER (marca) = 'nissan' AND refraccion = FALSE;




